    useS

    return (
        <div className="App">
            <Router>
                <div>
                    <HeaderComponent />
                    <Routes>
                        <Route path='/' element={<HomeComponent />} />
                        <Route path='/search' element={<HomeComponent />} />
                        <Route path='/products/:id' element={<ProductDetails/>} />
                    </Routes>
                    <FooterComponent />
                </div>
            </Router>
        </div>
    );
}

export default App;
